// Tells the Solidity compiler to compile only from v0.8.13 to v0.9.0
pragma solidity ^0.8.13;

contract B2BArticles {
  // state variables
  address seller;
  address buyer;
  string name;
  string description;
  uint256 price;

  // events
  event LogSellArticle(
    address indexed _seller,
    string _name,
    uint256 _price
  );
  event LogBuyArticle(
    address indexed _seller,
    address indexed _buyer,
    string _name,
    uint256 _price
  );

  // sell an article
  function sellArticle(string memory _name, string memory _description, uint256 _price) public {
    seller = msg.sender;
    name = _name;
    description = _description;
    price = _price;

    emit LogSellArticle(seller, name, price);
  }

  // get an article
  function getArticle() public view returns (
    address _seller,
    address _buyer,
    string memory _name,
    string memory _description,
    uint256 _price
  ) {
      return(seller, buyer, name, description, price);
  }

  // buy an article
  function buyArticle() payable public {
    // we check whether there is an article for sale
    require(seller != address(0));

    // we check that the article has not been sold yet
    require(buyer == address(0));

    // we don't allow the seller to buy his own article
    require(msg.sender != seller);

    // we check that the value sent corresponds to the price of the article
    require(msg.value == price);

    // keep buyer's information
    buyer = msg.sender;

    // the buyer can pay the seller
    payable(seller).transfer(msg.value);

    // trigger the event
    emit LogBuyArticle(seller, buyer, name, price);
  }
}

